import React, { useEffect, useState } from 'react'

const Edit = ({datas}) => {
  let [dats,setdats] = useState([])
  let datasarray
  useEffect(()=>{
     datasarray = []
    let dataS = localStorage.getItem("todo")
    var nameArr = dataS.split(',');
    datasarray.push(nameArr)

     setdats(datasarray)


  },[dats])
  return (
    <div>
      <h1>Todo list</h1>
      {dats && dats.map((item)=>{
        <p>
          {item}
        </p>
      })}
    </div>
  )
}

export default Edit
